import React from "react";

type JustinputPropsType = {
    setinTitle: (title:string)=>void;
    inTitle: string;
}


export const Justinput = () => {

    const onChangeInputHandler = (event: React.ChangeEvent<HTMLInputElement>) => {
        setinTitle(event.currentTarget.value)
    }

    return ( 
        <input value={inTitle} onChange={onChangeInputHandler} />
    );
};
